import React from 'react';
import Text from "./Text";
import ListServices from "./ListServices";
import "../css/layout.css"

function    TitleAndServices({title}) {
    const style = {
        justifyContent:"space-between",
        alignItems:"center",
        marginTop:'8%'
    }
    return (
        <div className="row" style={style}>
            <div style={{
                flex:0.4,
            }}>
                <Text text={title} fontWeight={700} color="#121212" size="3rem"></Text>
            </div>

            <ListServices design={true}></ListServices>
        </div>
    );
}

export default TitleAndServices;
